import React from 'react';
import "./Header.css"

 const Header=() => {
    return(
        <div className="header">
            <div className='sec1'>
                <div className='logo1'>
                    <img src='arrow.png' alt></img>
                </div>
            </div>


            <div className='sec2'></div>
        </div>
    );
 }

export default Header;
